    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature => {
        if (feature === null) {
            return '';
        } else if (typeof(feature)=='object') {
            return JSON.stringify(feature);
        } else {
            return feature;
        }
    }
    let fields = ["highway", "surface", "tracktype"];
    let aliases = ["highway", "surface", "tracktype"];
    let table = '<table>' +
        String(
        fields.map(

        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }

  "sticky": false,

});

    +'</table>';
    div.innerHTML=table;
    
    return div
    }
